import React from 'react';
import LogoNumeroUno from './Images/LogoNumeroUno.png';

const Header = (props) => {
	return (
		<div className="header-container">
			<img src={LogoNumeroUno} alt="LogoNumeroUno" />
		</div>
	);
};

export default Header;
